sys_variable_value.value:
(function execute(inputs, outputs) {
  var name = inputs['email'].split('@')[0].split('.')
  outputs['accountid'] = name[0] + name[1] + "SWO"
  outputs['password'] = Math.random().toString(36).substr(2, 8)
})(inputs, outputs);

